import React, { Component } from 'react';
import RichTextEditor from '../Components/RichTextEditor'
import PdfContent from '../Components/PdfContent'
class ManualUploadPage extends Component {
    state = {
        editorState:null
    }
    onEditorStateChange = (editorState) =>{
        this.setState({editorState});
        console.log(editorState + " from manual upload page");
    }
    render() { 
        return (  
            <div className="container">
                <div className="row">
                    <div className="col-6">
                        <RichTextEditor></RichTextEditor>
                        <div className="container text-center">
                            <button className="btn btn-info mt-2">Upload</button>
                        </div>
                        
                    </div>
                    <div className="col-6">
                        <PdfContent uploadFile = {this.props.location.state.uploadFile}></PdfContent>
                    </div>
                </div>
            </div>
        );
    }
}
export default ManualUploadPage;
